import styled from 'styled-components';
import '../resource/images/logo-bookmark.svg';

function Header() {
    return (
        <HeaderWrap>
            <Logo />
            <Gnb>
                <ul>
                    <li>
                        <a href="">Features</a>
                    </li>
                    <li>
                        <a href="">Download</a>
                    </li>
                    <li>
                        <a href="">Q&A</a>
                    </li>
                </ul>
            </Gnb>
        </HeaderWrap>
    );
}

const HeaderWrap = styled.div`
    max-width: 1400px;
`;
const Logo = styled.div``;
const Gnb = styled.nav``;
export default Header;
